INSERT INTO `pages` VALUES (1,'published',1,'2019-08-05 13:46:02','What is',1,'<p><strong style=\"color: rgb(0, 0, 0);\">KeyGenes is an algorithm to predict the identity</strong><span style=\"color: rgb(0, 0, 0);\">and determines identity scores of queried samples (test set) to a provided group of samples (training set). It uses transcriptional profiles of the queried data (test set) and matches them to sets of transcriptional profiles of organs or cell types (training set). KeyGenes uses a 10-fold cross validation on the basis of a LASSO (Least Absolute Shrinkage and Selection Operator) regression available in the R package glmnet&nbsp;</span><a href=\"http://145.88.35.43/\" target=\"_blank\">(Friedman et al., 2010)</a><span style=\"color: rgb(0, 0, 0);\">. ${test}</span></p><p><span style=\"color: rgb(0, 0, 0);\"></span></p>','what-is',NULL),(2,'published',1,'2019-08-05 13:50:15','Run Tool',0,'<p><strong style=\"color: rgb(0, 0, 0);\">KeyGenes algorithm </strong><span style=\"color: rgb(0, 0, 0);\">in order to run the algorithm enter the dataset and configure the parameters</span></p>','tool',NULL),(3,'published',1,'2019-08-06 13:27:47','How to use',0,'<h3>1. Provided fixed training sets</h3><p>KeyGenes has been developed and tested using NGS-derived human fetal transcriptional datasets as both training and test sets (Roost et al., 2015). The datasets used were expanded with available datasets on human adult tissues/organs (Cnop et al., 2014; Fagerberg et al., 2014; Illumina Body Map 2.0).</p><p>It is worth mentioning, that NGS-derived data of more human adult organs/tissues are available (Fagerberg et al., 2014; Illumina Bodymap 2.0; Epigenomic Roadmap; ENCODE) and could be incorporated as the datasets to be used as training sets are flexible and expandable. We provide seven basic fixed training sets, which are supposed to give users a headstart to assign both identity and developmental stages to their differentiated cells (test set). How to create and use a flexible training set is described in section 2.</p><h5>1. 1 Basic training set</h5><p>KeyGenes has been developed and tested using NGS-derived human fetal transcriptional datasets as both training and test sets (Roost et al., 2015). The datasets used were expanded with available datasets on human adult tissues/organs (Cnop et al., 2014; Fagerberg et al., 2014; Illumina Body Map 2.0).</p><p>It is worth mentioning, that NGS-derived data of more human adult organs/tissues are available (Fagerberg et al., 2014; Illumina Bodymap 2.0; Epigenomic Roadmap; ENCODE) and could be incorporated as the datasets to be used as training sets are flexible and expandable. We provide seven basic fixed training sets, which are supposed to give users a headstart to assign both identity and developmental stages to their differentiated cells (test set). How to create and use a flexible training set is described in section 2.</p><h4>1.1 Staging training sets</h4><p>KeyGenes has been developed and tested using NGS-derived human fetal transcriptional datasets as both training and test sets (Roost et al., 2015). The datasets used were expanded with available datasets on human adult tissues/organs (Cnop et al., 2014; Fagerberg et al., 2014; Illumina Body Map 2.0).</p><p>It is worth mentioning, that NGS-derived data of more human adult organs/tissues are available (Fagerberg et al., 2014; Illumina Bodymap 2.0; Epigenomic Roadmap; ENCODE) and could be incorporated as the datasets to be used as training sets are flexible and expandable. We provide seven basic fixed training sets, which are supposed to give users a headstart to assign both identity and developmental stages to their differentiated cells (test set). How to create and use a flexible training set is described in section 2.</p><h4>1.3 Other training sets</h4><p>KeyGenes has been developed and tested using NGS-derived human fetal transcriptional datasets as both training and test sets (Roost et al., 2015). The datasets used were expanded with available datasets on human adult tissues/organs (Cnop et al., 2014; Fagerberg et al., 2014; Illumina Body Map 2.0).</p><p>It is worth mentioning, that NGS-derived data of more human adult organs/tissues are available (Fagerberg et al., 2014; Illumina Bodymap 2.0; Epigenomic Roadmap; ENCODE) and could be incorporated as the datasets to be used as training sets are flexible and expandable. We provide seven basic fixed training sets, which are supposed to give users a headstart to assign both identity and developmental stages to their differentiated cells (test set). How to create and use a flexible training set is described in section 2.</p><h3>2. Web App</h3><h5>2.1. Web app using the provided fixed training sets</h5><p>The web app allows a prediction of NGS-derived data based on one of the fixed training sets described above in section 1.</p><p>To run the KeyGenes Web App, follow the steps below:</p><ol><li>Fill in your email address in the first field, so you will get the results in your mailbox.</li><li>Choose the fixed training set of interest from the dropdown menu.</li><li>Upload the test set containing the raw reads. The provided training sets are based on Ensembl Gene IDs. Therefore, the test set must be in a specific tab-separated text file with genes (Ensembl Gene IDs, no duplicates) as rows and the queried samples as columns. The queried samples should be labelled as follows: sample_additional information (e.g. stomach_adult patient 1). To get a meaningful prediction of the queried samples, the tissue/cell type of interest must be represented in the training set.</li><li>Press the submit button and check your mailbox for the results.</li></ol><h4>2.2. Web app using flexible training sets</h4><p>We are currently working on the Web App to allow the use of flexible training sets.</p>','how-to-use',NULL);
